Een arm stadje in Illinois komt bij elkaar om het lokale footballteam, The Harvey Colts, aan te moedigen en vooral hun nieuwe 
quarterback; Jasmine Plummer. Zij is de eerste vrouw in de geschiedenis van de Pop Warner league. Onder de leiding van haar oom 
Curtis, een voormalig high school footballster, leidt Jasmine haar team naar de Pop Warner superbowl en inspireert ze het dorpje 
om zijn oude glorie terug te winnen.
